import React from 'react';
import { NavLink } from 'react-router-dom';

interface IProps{

}
interface IState{


}
class Home extends React.Component<IProps,IState>
{
    constructor(props:IProps)
    {
        super(props)

    }   
        
    

    
    render()
    {
        return(
<React.Fragment>
<nav className="navbar navbar-expand-lg navbar-light ">
  <div className="container-fluid">
  <a className="navbar-brand text-white fa-2x" href="#"><i className="fa fa-snowflake-o pr-4" aria-hidden="true"></i> React Routing</a>
   
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarText" aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
   
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" >
      <ul className="navbar-nav me-auto mb-2 mb-lg-0">
    
        <li className="nav-item">
          <NavLink to="/about" className='nav-link text-white'>About</NavLink>
        </li>
        <li className="nav-item">
          <a className="nav-link text-white" href="#">Employees</a>
          <NavLink to="employees/list" className='nav-link text-white'>Employees</NavLink>
        </li>
        <li className="nav-item">
          <a className="nav-link text-white" href="#">Stocks</a>
        </li>
      </ul>
      <span className="navbar-item">
      <a className="nav-link text-info active" aria-current="page" href="#">Register</a>
      </span>
      <span className="navbar-item">
      <a className="nav-link text-info active" aria-current="page" href="#">Login</a>
      </span>
    </div>
  </div>
</nav>
 
 
</React.Fragment>
        )
    }
};
export default Home;
